import React from 'react';


const WholesaleStrategyPlanwithProjections = () => {
    return (
        <div className="container flex-container">
            <div className="row">
                <div className="col-md-1" />
                <div className="col-md-5">
                    <img id="shop-image" src="images/shop.png" alt='shop' />
                </div>
                <div className="col-md-5" id="shop-text" style={{ marginTop: "100px" }}>
                    <h2>Wholesale Strategy Plan with Projections</h2>
                    <p>Do we want to open retail accounts regionally first, select retailers (top 10), nationwide or combination?<br />
                    Each will have a separate plan and budget including trade show, marketing support, events<br /></p>
                </div>
                <div className="col-md-1" />
            </div>
        </div>
    )
}

export default WholesaleStrategyPlanwithProjections;
